import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the public events grid to load
    await page.waitForSelector('#publicEventsGrid');

    // Extract event cards
    const eventCards = await page.$$eval('.event-card', cards => {
      return cards.map(card => ({
        title: card.querySelector('.event-title') ? card.querySelector('.event-title').innerText : null,
        date: card.querySelector('.event-date') ? card.querySelector('.event-date').innerText : null,
        creator: card.querySelector('.event-creator') ? card.querySelector('.event-creator').innerText : null
      }));
    });

    // Take screenshot of the events grid
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_events_grid.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_events_grid.png'));

    // Verify that events are displayed
    const success = eventCards.length > 0;

    return {
      success,
      action: success ? "Public events displayed successfully" : "No public events found",
      extractedData: { eventCards },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

